package com.gstarcad.website.entity;import java.util.Date;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.Table;/** * * @ClassName: Software * @Description: TODO(这里用一句话描述这个类的作用) * @author fengzf fengzf@gstarcad.com   * @date Mar 15, 2018 5:25:26 PM * @version Vxxx (项目版本)* @redmine #xxx (redmine中的#编号)   * @update @Description TODO(这里用一句话描述这个方法的作用) * @update @author fengzf fengzf@gstarcad.com   * @update @date Mar 15, 2018 5:25:26 PM */@Entity@Table(name = "software")public class Software implements java.io.Serializable {	@Id	@GeneratedValue(strategy = GenerationType.AUTO)	@Column(name = "id")	private Long id;		/** software名称 **/	private String name;		/** 是否删除：0、是；1、否 **/	private Integer isdelete;		private Date createtime;	public Long getId() {		return id;	}	public String getName() {		return name;	}	public Integer getIsdelete() {		return isdelete;	}	public void setId(Long id) {		this.id = id;	}	public void setName(String name) {		this.name = name;	}	public void setIsdelete(Integer isdelete) {		this.isdelete = isdelete;	}	public Date getCreatetime() {		return createtime;	}	public void setCreatetime(Date createtime) {		this.createtime = createtime;	}	}